import React from "react";
import "./Components.css";
import me from './me.jpg'
import Particles from 'react-particles-js'

function Home() {
  return (
    
    <div className="home">
      <Particles id="particles-js"
            params={{
                particles: {
                    number: {
                        value: 400,
                        density: {
                            enable: true,
                            value_area: 1000
                        }
                    },
                    color: {
                        value: '#fff'
                    },
                    opacity: {
                        value: 0.5,
                        anim: {
                            enable: true
                        }
                    },
                    size: {
                        value: 7,
                        random: true,
                        anim: {
                            enable: true,
                            speed: 3
                        }
                    },
                    line_linked: {
                        enable: false
                    },
                    move: {
                        speed: 0.2
                    }
                 }    
            }}    
        />
      
        <img src={me} alt="Me"/>
        <h2>home</h2> 
  
    </div>
   
  );
}

export default Home;
